import {leontoolsApi} from "./apiCall";
import axios from "axios";
import randomText from "../helpers/randomText";

function createSession(googleId, userIp) {
    return axios.post(leontoolsApi+"sessions/add/", {
        session_id: randomText(10),
        google_id: googleId,
        ip_address: userIp,
        user_agent: navigator.userAgent
    })
}

export default createSession;
